import React from "react";

function Post({ post, readme }) {
  return (
    <div>
      {post.date}
      {post.author}
      {post.title}
      {readme ? (
        <p dangerouslySetInnerHTML={{ __html: readme }}></p>
      ) : (
        <p>{post.content}</p>
      )}
    </div>
  );
}

export default Post;
